import React, { useState, useEffect } from "react";

const Country = () => {
  const [country, setCountry] = useState([]);
  const [name, setName] = useState(0);

  useEffect(() => {
    fetch(
      "https://restcounhttps://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY&libraries=places&callback=initMaptries.eu/rest/v2/all"
    )
      .then((res) => res.json())
      .then((result) => {
        setCountry(countryName(result));
        console.log(result);
      });
  }, []);

  const countryName = (country) => {
    return country.map((d) => d.name);
  };

  return (
    <>
      <h1>{name}</h1>
      <button
        onClick={() =>
          setName(country[Math.floor(Math.random() * country.length)])
        }
      >
        Click me
      </button>
    </>
  );
};

export default Country;

